import { connect } from 'react-redux'

import SingleBox from '../../components/commom/SingleBox'
import moduleName from '../../redux/'

function a(state) {
  console.log(state);
  return {
    singleBox: state.SingleBox
  }
}
function b(dispatch) {
  return {
    singleBoxFocusValue:(data)=>{dispatch()}
  }
}

export default connect(a, b)(SingleBox)
